  overflow: hidden;
  background: #722789;
  position: relative;
  border-bottom: 1px solid #000;
`;

const Logo = styled.div`
  width: 50%;
  float: left;
`;

const LogoText = styled

export const NavBar = ({logoText}) => {
  return (
    <NavbarSection>
      <div className="container">
        <Logo>
          <h2 className="logo-text">{logoText}</h2>
        </Logo>
        <ul className="ul-list">
          <li>Inicio</li>
          <li>Beneficios</li>
          <li>Ventajas</li>
        </ul>
      </div>  
    </NavbarSection> 
  ) 
}

export default NavBar;
